import React from 'react';
import styled from 'styled-components';

const StyledTab = styled.div`
  display: flex;
  height: 50px;
  .active {
    background-color: blue;
  }
`
const Tab = ({room, deleteAndUpdate, update, className}) => {
  return (
    <StyledTab>
      <div className={className} onClick={update}>
        {room}
      </div>
      <button onClick={deleteAndUpdate}/>
    </StyledTab>
  )
}

export default Tab;
